import { NgModule } from '@angular/core';
import { ScormWrapperService } from './services';
import { WindowRef } from './services/window-ref';
var ScormWrapperModule = /** @class */ (function () {
    function ScormWrapperModule() {
    }
    ScormWrapperModule.decorators = [
        { type: NgModule, args: [{
                    providers: [
                        ScormWrapperService,
                        WindowRef
                    ],
                    exports: []
                },] },
    ];
    /** @nocollapse */
    ScormWrapperModule.ctorParameters = function () { return []; };
    return ScormWrapperModule;
}());
export { ScormWrapperModule };
